import React from 'react';
import '../App.css';
import Grid from '@mui/material/Grid';
import { useNavigate, Navigate, Link } from 'react-router-dom';
import {
  Typography,
  Container,
  List,
  ListItem,
  Divider,
  ListItemText,
  ListItemButton,
} from '@mui/material';
import { styled, useTheme } from '@mui/system';
import { createTheme } from '@mui/material/styles';

const ProgButton = styled('button')({
  backgroundColor: '#0171e3',
  width: '430px',
  height: '50px',
  margin: '10px',
  color: 'white',
  padding: '5px 10px',
  border: 'none',
  borderRadius: '5px',
  alignSelf: 'center',
  cursor: 'pointer',
});

const Box = styled('div')({
  display: 'flex',
  height: '100%',
  border: '1px solid #6D8472',
  borderRadius: '15px',
  padding: '10px'
});

function Contact({ token, setTokenFunction }) {
  return <>
  <Grid
        sx={{
          flexGrow: 1, height: "800px",
          px: { xs: "10px", sm: "25px", md: "100px", lg: "150px", xl: "200px" }
        }}
        container spacing={2}
      >
        <Grid item xs={8}>
          <Typography sx={{ fontSize: "1rem", color: "#a7a396" }}>
            Step <b>3</b> of <b>3</b>
          </Typography>
          <Typography sx={{ fontSize: "2rem", fontWeight: "500" }}>
            Checkout and Summary
          </Typography>
          <Box sx={{ height: "80%", position: "relative" }}>

          </Box>
        </Grid>
        <Grid item xs={4}>
        </Grid>
        <div style={{ display: 'flex', justifyContent: 'center', width: '100%' }}>
          <ProgButton onClick={openModals}>Next</ProgButton>
        </div>
      </Grid>
  </>
}

export default Contact;
